// https://base64.guru/converter/encode/image
const regExpForGenSvg = /<\?xml version="[^"]+" encoding="[^"]+"\?>\n|<title>.+<\/title>|<desc>.+<\/desc>/g;
function icons({ name, fill = 'var(--vkui--color_icon_accent)', size }) {
    let icon = iconsBase64[name];

    if (!icon) {
        return '';
    }

    if (name === 'logo') {
        return `<img style="display: block; width: ${size}px; height: ${size}px; border-radius: 50%;" src="data:image/jpeg;base64,${icon}"/>`;
    }

    if (!/^(<svg)/.test(icon)) {
        let svgHtml = atob(icon);

        if (regExpForGenSvg.test(svgHtml)) {
            svgHtml = svgHtml.replace(regExpForGenSvg, '');
        }

        icon = (iconsBase64[name] = svgHtml);
    }

    const doneIcon = icon.trim().replace(/ /, ` style="display: block; color: ${fill}; width: ${size}px; height: ${size}px"`);

    return doneIcon;
};